import { Container, Grid } from "@material-ui/core";
import DashboardCard from "../Components/Dashboard/DashboardCard"

const DashBoard = () => {
    return ( 
        <div>
            <Container>
                <Grid>
                    <DashboardCard />
                </Grid>
            </Container>

        </div>
     );
}
 
export default DashBoard;
